import React from 'react'

function Infoblock() {
  return (
    <div className="infoblock">
      <div className="specifications">
        <div className="specifications-items">
          <div className="name"></div>
          <div className="number"></div>
        </div>
      </div>
    </div>
  );
}

export default Infoblock
